import React from 'react';
import {
  Route,
  Routes,
} from 'react-router-dom';

function App() {
  return (
      <>
    <div className="App">
      <h1>Балабаба</h1>

      <Routes>
        <Route />
      </Routes>
    </div>
      </>
  );
}

export default App;
